// CHECK if location has been saved before
app.get('/api/coords', function(req,res){
	var location = req.query.loc;

	console.log(location);

	db.translations.find({location:location},function(err, docs) {
    	if (err || !docs) {
    		console.log(err);
    	}
    	else {
    		if ((!Array.isArray(docs) || !docs.length) ){
    			console.log("New location – create new entry");
    			new_location = location;
    			createNewLoc(new_location);
    			res.send("NONE");
    		} else {
    			console.log(docs);
      			res.send(docs);
    		}	
    	}
  	});
});

