//save new entry to database
function createNewLoc(new_location){
	db.translations.save({
					"location":new_location,
					"translations": []
				}, function(err, saved) {
					if( err || !saved ) console.log("new location is not created");
					else console.log("new location: "+new_location+" is created");
				});
}


